import React, { createContext } from 'react';

const themes = {
  light: {
    foreground: '#000000',
    background: '#eeeeee',
  },
  dark: {
    foreground: '#ffffff',
    background: '#222222',
  },
};

const RoomContext = createContext(themes);

const RootContext = ({ children }) => {
  return (
    <RoomContext.Provider value={themes.dark}>{children}</RoomContext.Provider>
  );
};

export default RootContext;
